		"full_text": "&lt;나에게 영감이 되는 무엇&gt;\n\n잔다리 페스타 1인자 공윤영 aka 달새\n\n진정성은 혼자 지켜낼 수 없다. 함께 같이 이 가치를 만들어내야 한다. 그걸 아는 사람이기에 보스로 함께 일할 수 있다. 이 세상에 진정성이 있겠느냐만은 진정성을 찾기 위해 계속 탐구해야 하고 이 행위는 멈추지 않아야 한다.",
