		"text": "저의 첫 번째 책 &lt;사랑하는 미움들&gt;이 오늘 발간되었습니다. 지난 일 년간 쓰며 모은 글들이에요. 심각하기도 웃기기도 한 이 글들을 쓰며 화를 풀고 좋아진 기분이 들어요. 여러분이 어떻게 읽어주실지 궁금하고 긴장되네요. 에필로그 - 안부 부분을 남깁니다. 세상에 있어주어 고마워요. https://t.co/80c6M34muo"
