		"text": "몸에 염증을 발생시키는 음식들 : 즉,가공된 고기(햄, 소세지, 패티등등), 소다나 설탕이 함유된 음료(콜라, 각종 과일음료, 커피의 액상과당 등등), 그리고, 정제된 탄수화물(흰빵, 흰떡, 하얀쌀, 밀가루, 밀가루로 만든 각종 쿠키류등등)을 섭취하는 사람들은 대장암의 발생비율이 44%나 올라갔다고. https://t.co/UAraZk9VGp"
